import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./pages/Home";
import News from "./pages/News";
import Rules from "./pages/Rules";
import Gallery from "./pages/Gallery";
import Contact from "./pages/Contact";

function App() {
  return (
    <Router>
      <div>
        <nav style={{ padding: "10px", background: "#e0e0e0" }}>
          <Link to="/" style={{ margin: "10px" }}>üè† Startsida</Link>
          <Link to="/news" style={{ margin: "10px" }}>üì∞ Nyheter</Link>
          <Link to="/rules" style={{ margin: "10px" }}>üé£ Regler</Link>
          <Link to="/gallery" style={{ margin: "10px" }}>üì∏ Galleri</Link>
          <Link to="/contact" style={{ margin: "10px" }}>üìû Kontakt</Link>
          <a href="https://www.ifiske.se" target="_blank" rel="noopener noreferrer" style={{ margin: "10px" }}>üîó iFiske</a>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/news" element={<News />} />
          <Route path="/rules" element={<Rules />} />
          <Route path="/gallery" element={<Gallery />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
